<strong>idTabs</strong> is a plugin for <a href="http://www.jquery.com/" target="_blank">jQuery</a>.
It makes adding tabs into a website super simple.
But it can also open the door to endless possiblities.
Getting started is easy, just <a href="http://www.sunsean.com/idTabs/jquery.idTabs.min.js" target="_blank">download </a>the program above,
and copy and paste the following code into the <strong><code>&lt;head&gt;</code></strong>
[html]&lt;scripttype=&quot;text/javascript&quot;src=&quot;jquery.idTabs.min.js&quot;&gt;&lt;/script&gt;[/html]
Now any <strong><code>&lt;ahref="#tab"&gt;</code></strong> inside of an element with <strong><code>class="idTabs"</code></strong>
will show the element with <strong><code>id="tab"</code></strong>. See below for a better example.
